import osmanthus from "./Images/osmanthus.png";
import oud from "./Images/agarwood.png";
import patchouli from "./Images/patchouli.png";
import rose from "./Images/rose.png";
import sandalwood from "./Images/sandalwood.png";
import vanilla from "./Images/vanilla.png";
import vetiver from "./Images/vetiver.png";
import verveine from "./Images/verveine.png";
import ylangylang from "./Images/ylang-ylang.png";

const plants2 = [
{
  id: "19",
  img: osmanthus,
  name: "Osmanthus",
  desc:
    "Osmanthus is a genus of about 30 species of flowering plants in the family Oleaceae. Most of the species are native to eastern Asia (China, Japan, Korea, Indochina, the Himalayas) with a few species from the Caucasus, New Caledonia and Sumatra.Their scent and flavour is likened to apricot and peach.",
},
{
  id: "20",
  img: oud,
  name: "Oud",
  desc:
    "Oud,derived from the tropical agar tree, can be found growing in the Middle East and it is thought to have originated in Assam, India.The agar tree becomes infected by a mould called phialophora parasitica and then produces a dark, dense, fragrant resin to protect itself.The resin becomes embedded in the tree and is the source of oud.",
},
{
  id: "21",
  img: patchouli,
  name: "Patchouli",
  desc:
    "The heavy and strong scent of patchouli has been used for centuries in perfumes and, more recently, in incense, insect repellents, and alternative medicines. The word derives from the Tamil patchai (green), ellai (leaf). In Assamese it is known as xukloti. In Kannada it is known as Pachhethene.",
},

  {
    id: "22",
    img: rose,
    name: "Rose",
    desc:
      "Rose perfumes are made from rose oil (also called attar of roses), which is a mixture of volatile essential oils obtained by steam distilling the crushed petals of roses. An associated product is rose water which is used for cooking, cosmetics, medicine and religious practices.",
  },
  {
    id: "23",
    img: sandalwood,
    name: "Sandalwood",
    desc:
      "Sandalwood is a class of woods from trees in the genus Santalum. The woods are heavy, yellow, and fine-grained. They retain their fragrance for decades. Sandalwood oil is extracted from the woods for use.",
  },
  {
    id: "24",
    img: vanilla,
    name: "Vanilla",
    desc:
      "Vanilla is a spice derived from orchids of the genus Vanilla, primarily obtained from pods of the Mexican species.Vanilla is the second-most expensive spice after saffron because growing the vanilla seed pods is labor-intensive.",
  },
  {
    id: "25",
    img: verveine,
    name: "Verveine",
    desc:"The use of vervain for medicinal, ceremonial, and superstitious purposes goes back thousands of years. Ancient cultures throughout Europe have held vervain in high esteem. The significance of vervain as a cultural symbol and healing plant is partly how it acquired its many names. Even its nicknames convey adoration, as in: the herb of love and the herb of the cross."
  },
    {
    id: "26",
    img: vetiver,
    name: "Vetiver",
    desc:
      "Chrysopogon zizanioides, commonly known as vetiver, is a perennial bunchgrass of the family Poaceae, native to India.Vetiver is mainly cultivated for the fragrant essential oil distilled from its roots.",
  },

  {
    id: "27",
    img: ylangylang,
    name: "Ylang-Ylang",
    desc:
      "Cananga odorata, known as the cananga tree,is a tropical tree that is native to India, through parts of Indochina, Malaysia, the Philippines and Indonesia, to Queensland, Australia. It is valued for the perfume extracted from its flowers, called ylang-ylang. ",
  },
];
export default plants2;
